import React from "react";

function Page({ toNext, toPrev }) {
  return (
    <div>
      {toPrev && (
        <button className="btn" onClick={toPrev}>
          Previous
        </button>
      )}
      {toNext && (
        <button className="btn" onClick={toNext}>
          Next
        </button>
      )}
    </div>
  );
}

export default Page;
